// props() = properties --- means pass the information one componentm to anothere component
//it declare with in object
// immutable ---- we cant update

function App9(props) {
    return (
        <div>
            <h2>properties</h2>
            <p>name:{props.name}</p>
            <p>age:{props.age}</p>
            <p>city:{props.city}</p>
            <p>state:{props.state}</p>
            <p>country:{props.country}</p>


        </div>
    )
}

export default App9;
